import React from 'react';
import Nav from 'react-bootstrap/Nav'


function Classes() {
  return (
    <div className="Classes">
      <Nav justify variant="tabs" defaultActiveKey="/home" defaultActiveKey="link">
        <Nav.Item>
          <Nav.Link eventKey="link" href="">Degree Plan</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1" href="">Courses Taken </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2" href="">Courses Not Taken</Nav.Link>
        </Nav.Item>
      </Nav>
      <img href="https://cse.uta.edu/current-students/docs/guides/CS%202019-2020%20Flowchart.pdf"></img>
    </div>
  );
}

export default Classes;
